Defendant Daniel A Buettner in court with attorney Jorge R Fragoso.   District Attorney's Office Law Intern  supervised by Atty. Lucas Bennewitz appeared for the State of Wisconsin.
Plea Colloquy.
Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.  Count 2 is dismissed by operation of law.  

The Court Orders the Following:

Imposed Sentence of:

108 months Imprisonment (Credit - 1 day )
- 48 months of Initial Confinement
- 60 months of Extended Supervision

Conditions of Extended Supervision:
- AODA Assessment and follow through with any treatment recommended;
- Mental Health Evaluation and follow through with any treatment recommended;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Be involved in a 12 step program 2 times per week within a week of release onto ES and obtain a sponsor/mentor within the first 30 days of release onto ES
- Take a Cognitive Thinking Course;
- Operate a Motor Vehicle with a Valid Drivers License;
- Maintain/Obtain full time employment;
- Provide DNA sample if not yet provided  and pay surcharge.

Fine: $4563.00 BAIL TO APPLY
DNA surcharge: $250.00 BAIL TO APPLY
BLOOD DRAW FEE:  $35.00 to be paid through Waukesha County Circuit Court to be forwarded to  Brookfield Police Department.
TRANSCRIPT FEE:  $8.00 to be paid through Waukesha County Circuit Court to be forwarded to Waukesha DA Office.


DL REVOCATION:  36 months.

IGNITITION INTERLOCK: 36 months.

Defendant to attend the Victim Impact Panel on: Within 3 months of release onto Extended Supervision

Defendant is not eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
